import React from 'react';
import { Link } from 'react-router-dom';
import './Home.css';

function Home() {
  return (
    <div className="page home">
      <div className="container">
        <h1 className="hero-title">Welcome to Roamio-Wanderly</h1>
        <p className="hero-subtitle">Explore Nepal with us!</p>
        <p className="hero-description">
          Your ultimate travel companion to discover amazing destinations
        </p>
        <Link to="/contact" className="cta-btn">
          Get Started
        </Link>
      </div>
    </div>
  );
}

export default Home;
